def all_left_right_truncatable_prime(numbers):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    def is_truncatable_prime(n):
        if '0' in str(n):
            return False
        n = str(n)
        while len(n) > 2:
            if not is_prime(int(n)):
                return False
            n = n[1:-1]
        return is_prime(int(n))

    x = numbers[32]
    primes = []
    for i in range(2, x + 1):
        if is_truncatable_prime(i):
            primes.append(i)
    return primes
